import React from "react";
import { motion } from "framer-motion";
import { Canvas } from "@react-three/fiber";
import { OrbitControls, useGLTF } from "@react-three/drei";

// 3D Model Loader
function Model({ path, scale }) {
  const { scene } = useGLTF(path);
  return <primitive object={scene} scale={scale} />;
}

const AboutPage = () => {
  return (
    <div className="bg-gradient-to-b from-blue-900 to-black text-white min-h-screen flex flex-col">
      {/* Hero Section */}
      <section className="relative flex flex-col md:flex-row items-center justify-between px-8 md:px-20 py-20">
        {/* Left Content */}
        <motion.div
          initial={{ opacity: 0, x: -50 }}
          animate={{ opacity: 1, x: 0 }}
          transition={{ duration: 1 }}
          className="w-full md:w-1/2 space-y-6"
        >
          <h1 className="text-5xl font-bold">About Our School</h1>
          <p className="text-lg text-gray-300 leading-relaxed">
            Our school is dedicated to nurturing students into lifelong learners
            and global citizens. With over 20 years of excellence, we provide
            world-class education, innovative teaching, and vibrant campus life.
          </p>
          <button className="px-6 py-3 bg-yellow-500 text-black font-semibold rounded-2xl hover:bg-yellow-400 transition">
            Learn More
          </button>
        </motion.div>

        {/* Right 3D Model */}
        <motion.div
          initial={{ opacity: 0, scale: 0.8 }}
          animate={{ opacity: 1, scale: 1 }}
          transition={{ duration: 1 }}
          className="w-full md:w-1/2 h-[400px]"
        >
          <Canvas camera={{ position: [0, 1, 5], fov: 50 }}>
            <ambientLight intensity={0.8} />
            <directionalLight position={[2, 2, 5]} intensity={1.2} />
            <Model path="/models/graduation_cap.glb" scale={2.5} />
            <OrbitControls autoRotate enableZoom={false} />
          </Canvas>
        </motion.div>
      </section>

      {/* Mission Section */}
      <section className="px-8 md:px-20 py-16 grid md:grid-cols-2 gap-12 items-center">
        <motion.div
          initial={{ opacity: 0, x: -60 }}
          whileInView={{ opacity: 1, x: 0 }}
          transition={{ duration: 1 }}
          className="h-[300px] rounded-2xl overflow-hidden shadow-lg"
        >
          <Canvas camera={{ position: [0, 0, 5], fov: 50 }}>
            <ambientLight intensity={0.8} />
            <directionalLight position={[2, 2, 5]} />
            <Model path="/models/books.glb" scale={1.5} />
            <OrbitControls autoRotate enableZoom={false} />
          </Canvas>
        </motion.div>

        <motion.div
          initial={{ opacity: 0, x: 60 }}
          whileInView={{ opacity: 1, x: 0 }}
          transition={{ duration: 1 }}
          className="space-y-4"
        >
          <h2 className="text-3xl font-bold">Our Mission</h2>
          <p className="text-gray-300 leading-relaxed">
            To empower every student with knowledge, creativity, and
            confidenceâ€”shaping leaders who can inspire the future. Our programs
            foster innovation, curiosity, and excellence in academics and beyond.
          </p>
        </motion.div>
      </section>

      {/* Vision Section */}
      <section className="px-8 md:px-20 py-16 grid md:grid-cols-2 gap-12 items-center">
        <motion.div
          initial={{ opacity: 0, x: -60 }}
          whileInView={{ opacity: 1, x: 0 }}
          transition={{ duration: 1 }}
          className="space-y-4"
        >
          <h2 className="text-3xl font-bold">Our Vision</h2>
          <p className="text-gray-300 leading-relaxed">
            To be a global leader in education, inspiring generations with a
            passion for learning, cultural understanding, and innovation. We
            envision a world where education creates equality and opportunity.
          </p>
        </motion.div>

        <motion.div
          initial={{ opacity: 0, x: 60 }}
          whileInView={{ opacity: 1, x: 0 }}
          transition={{ duration: 1 }}
          className="h-[300px] rounded-2xl overflow-hidden shadow-lg"
        >
          <Canvas camera={{ position: [0, 0, 5], fov: 50 }}>
            <ambientLight intensity={0.8} />
            <directionalLight position={[2, 2, 5]} />
            <Model path="/models/globe.glb" scale={1.8} />
            <OrbitControls autoRotate enableZoom={false} />
          </Canvas>
        </motion.div>
      </section>

      {/* Achievements */}
      <section className="bg-yellow-500 text-black py-16 px-8 md:px-20 grid md:grid-cols-3 gap-12 text-center">
        <motion.div initial={{ opacity: 0, y: 40 }} whileInView={{ opacity: 1, y: 0 }} transition={{ duration: 0.8 }}>
          <h3 className="text-5xl font-bold">20+</h3>
          <p className="text-lg">Years of Excellence</p>
        </motion.div>
        <motion.div initial={{ opacity: 0, y: 40 }} whileInView={{ opacity: 1, y: 0 }} transition={{ duration: 0.8, delay: 0.3 }}>
          <h3 className="text-5xl font-bold">5k+</h3>
          <p className="text-lg">Students Graduated</p>
        </motion.div>
        <motion.div initial={{ opacity: 0, y: 40 }} whileInView={{ opacity: 1, y: 0 }} transition={{ duration: 0.8, delay: 0.6 }}>
          <h3 className="text-5xl font-bold">50+</h3>
          <p className="text-lg">Awards & Recognitions</p>
        </motion.div>
      </section>
    </div>
  );
};

export default AboutPage;
